  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selected geographic and cartographic information
  from then               U.S. Census Bureau's Master Address File / Topologically
  Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB).  The
  MTDB representsn               a seamless national file with no overlaps or gaps
  between parts, however, each TIGER/Line shapefile is designed to stand alone as
  an independent datan               set, or they can be combined to cover the entire
  nation.  Estates are subdivisions of the three major islands in the United States
  Virgin Islands (USVI).n               The estates have legally defined boundaries
  and are much smaller in area than the Census Subdistricts (county subdivisions),
  but do not necessarily nestn               within these districts.  The boundaries
  of the estates are primarily those of the former agricultural plantations that existed
  at the time Denmarkn               transferred the islands to the United States
  in 1917.  The names and boundaries of the estates are in common usage by residents
  and in governmentn               administration.  The boundaries of the estates
  are as of January 1, 2010 and were provided to the Census Bureau by the USVI Office
  of the Lieutenantn               Governor.  Estates can be found in the Sub Minor
  Civil Division (submcd) shapefile for the 2010 and 2011 TIGER/Line products.\",\n\t\"license_title\":
